import React from 'react';
import './App.css';
import Canvas from './Canvas';
import Sidebar from './Sidebar';
import { ElementProvider } from './ElementContext';

function App() {
  return (
    <ElementProvider>
          <div className="App">
            <Canvas />
            <Sidebar />
          </div>
    </ElementProvider>
  )
}

export default App
